<template>
  <div id="bannerroot">
    <div class="bannerbox" ref="bannerbox" :style="{ 'transform': bannertranslate }"> 
      <img class="bannerimage" v-for="(url,id) in imageurls" :key="id" v-bind:src="url"/>
    </div>
  </div>
</template>

<script>
export default {
  data: function(){
    return {
      bannerX: 0
    }
  },
  computed:{
    bannertranslate: function(){
      return 'translateX(' + this.bannerX + 'px)'
    },
  },
  props: {
    imageurls:{
      type:Array,
      default: function(){
        return [defaultImage,defaultImage]
      }   
    }
  },
  mounted: function(){
    let box = this.$refs['bannerbox']
    box.addEventListener('touchmove',function(event){
      console.log(event.targetTouches[0]['clientX'])
    })
  }
}

let defaultImage = `
data:image/jpeg;base64,
`
</script>

<style scoped lang="less">
#bannerroot {
    position: relative;
    overflow: hidden;

}
.bannerbox {
  display: flex;
  width: 100%;
  height: 100px;
}
.bannerimage {
  width: calc(100vw - 20px);
  margin: 10px;
  border: 1px red solid;
}
</style>
